import { LeftOutlined, RightOutlined } from "@ant-design/icons";
import { Button, Card, Col, Row } from "antd";
import { React, useRef } from "react";
import "typeface-poppins";
import "../../../App.css";
import { CourseCard } from "../../Utils/CourseCard/CourseCard";
import { courses, testimonials, usp } from "./Const";
import "./LandingPage.css";
import { TextWithHrLine } from "../../Utils/TextWithHrLine/TextWithHrLine";
import { UspCard } from "../../Utils/UspCard/UspCard";
import Person from "../../Assets/bgImage.png";
import Shadow from "../../Assets/shadow.png";
export const LandingPage = () => {
  const sliderRef = useRef(null);

  const scrollLeft = () => {
    sliderRef.current.scrollBy({ left: -300, behavior: "smooth" });
  };

  const scrollRight = () => {
    sliderRef.current.scrollBy({ left: 300, behavior: "smooth" });
  };

  return (
    <main>
      <div>
        <section id="home" className="hero">
          <div className="hero-text" style={{ display: "flex" }}>
            <svg width="300" height="300" viewBox="0 0 24 24" fill="yellow">
              <polygon points="12,2 15,8 22,8 17,12 19,19 12,15 5,19 7,12 2,8 9,8" />
              <polygon points="6,2 9,8 16,8 11,12 13,19 6,15 1,19 3,12 -2,8 5,8" />
              <polygon points="18,4 21,10 28,10 23,14 25,21 18,17 11,21 13,14 8,10 15,10" />
            </svg>
            <div className="home-page-asset" style={{ marginLeft: "-5%" }}>
              <img
                className="shadow"
                src={Shadow}
                alt="shadow"
                style={{ height: "550px" }}
              />
              <img
                className="person"
                src={Person}
                alt="person"
                style={{ height: "550px" }}
              />
            </div>
            <div>
              <h1>Welcome to Our E-Learning Platform</h1>
              <p>
                Expand your knowledge and skills with our expert-led courses.
                Learn at your own pace and achieve your career goals.
              </p>
            </div>
          </div>
        </section>

        <section id="courses" className="courses">
          <h2>
            <TextWithHrLine data={{ text: "Our Courses", color: "white" }} />
          </h2>
          <Row gutter={16}>
            <Button className="arrow-button left" onClick={scrollLeft}>
              <LeftOutlined />
            </Button>
            <div className="card-slider-container" ref={sliderRef}>
              {courses.map((course, index) => (
                <Col span={6} key={index}>
                  <CourseCard course={course} />
                </Col>
              ))}
            </div>
            <Button className="arrow-button right" onClick={scrollRight}>
              <RightOutlined />
            </Button>
          </Row>
        </section>

        <section id="usp" className="usp">
          <h2>
            <TextWithHrLine
              data={{
                text: "Our Recipe to Transform Your Career",
                color: "white",
              }}
            />
          </h2>
          <Row className="usp-body" gutter={16}>
            {usp.map((usp, index) => (
              <Col span={8} key={index}>
                <UspCard data={usp} />
              </Col>
            ))}
          </Row>
        </section>

        <section id="testimonials" className="testimonials">
          <h2>
            <TextWithHrLine
              data={{ text: "What Our Students Say", color: "white" }}
            />
          </h2>
          <Row gutter={16}>
            {testimonials.map((testimonial, index) => (
              <Col span={8} key={index}>
                <Card bordered={false}>
                  <p>
                    <strong>{testimonial.name}</strong>
                  </p>
                  <p>{testimonial.text}</p>
                </Card>
              </Col>
            ))}
          </Row>
        </section>

        <footer id="about" className="footer">
          <h2>About Us</h2>
          <p>
            Our mission is to provide high-quality education accessible to
            everyone. We offer a variety of courses tailored to meet your
            learning needs.
          </p>
        </footer>
      </div>
    </main>
  );
};
